import { Icon } from '@iconify/react';
export const sideBarButtons = [
    {
        btnName:"Dashboard",
        icons:<Icon font icon="humbleicons:dashboard" hFlip={true} />
    },
    {
        btnName:"Courses",
        icons:<Icon icon="healthicons:register-book-outline" hFlip={true} />
    },
    {
        btnName:"Students",
        icons:<Icon icon="healthicons:i-groups-perspective-crowd-outline" />
    },
    {
        btnName:"Exams",
        icons:<Icon icon="emojione-monotone:writing-hand" />
    },
    {
        btnName:"Results",
        icons:<Icon icon="fluent:clipboard-letter-20-regular" />
    },
    {
        btnName:"Notice Board",
        icons:<Icon icon="ps:data-board" />
    },
    {
        btnName:"Live Classes",
        icons:<Icon icon="fluent:live-24-filled" />
    },
    {
        btnName:"Notifications",
        icons:<Icon icon="bytesize:bell" />
    }
]
